import React from 'react';

const tiles={
    width: '60%', 
    height: 'auto',
};

class workTiles extends React.Component{
    render(){
        return(
            <div style={{display: 'flex'}}>
                <div>
                    <img src={require('../images/FacebookCard.svg')} alt='Facebook Card'/>
                    <img src={require('../images/DesignCard.svg')} alt='Design Card'/>
                </div>
                <div>
                    <img src={require('../images/ITSCard.svg')} alt='ITS Card'/>
                    <img src={require('../images/InfoPostCard.svg')} alt='InfoPost Card'/>
                </div>
                <div>
                    <img src={require('../images/RandomCard.svg')} alt='Facebook Card'/>
                    <img src={require('../images/MiscellaneousCard.svg')} alt='Miscellaneous Card'/>
                </div>
            </div>
        );
    }
}

export default workTiles;
